import React from "react";

const a=["üòö","üèπ","üåû"]

         for(let i=0;i<a.length;i++){
      
                  let r=Math.floor(Math.random()*3)
                  let s=a[r]
                  let {x,y,z}=s
         }      

const Slot =() => {
         
                 if(x===y && y===z){
                            return (
                                    <>
                                       <div className="slot+timer">
                                           <h1>
                                                 {x} {y} {z}
                                           </h1>
                                          <h1>This is matching</h1>
                                       </div>
            
            
                                    </>
                                   )
                                  }
        }
    

    export default Slot
